def threeSum(nums):
    hMap = {}
    res = []

    for n in nums:
        hMap[n] = 1 + hMap.get(n, 0)

    for i in range(len(nums)):
        # Difference you need to find with 2 numbers other than n
        sum2diff = 0 - nums[i]

        for j in range(i+1, len(nums)):
            diff = sum2diff - nums[j]

            if diff in hMap:
                if (diff == nums[i]
                    and diff == nums[j]
                    and hMap[diff] < 3):
                    continue
                elif diff == nums[i] and hMap[diff] < 2:
                    continue
                elif diff == nums[j] and hMap[diff] < 2:
                    continue
                else:
                    temp = sorted([nums[i], nums[j], diff])
                    if temp not in res:
                        res.append(temp)

    return res

print(threeSum([-1,0,1,2,-1,-4]))
print(threeSum([0,1,1]))
print(threeSum([0,0,0]))
